   process_node_no      smallint,
   memo                 varchar(200),
   valid_flag           varchar(4) comment '是否有效',
   create_time          datetime comment '创建时间',
   update_time          datetime comment '更新时间',
   operate_man          varchar(120) comment '操作人',
   operate_reason       varchar(200) comment '操作原因',
   institution_id       varchar(32) comment '机构id',
   primary key (process_model_node_id)
);
alter table tb_process_model_node comment '业务流程模板节点';
alter table tb_process_model_node add constraint FK_Relationship_140 foreign key (process_model_id)
